import {createSlice} from "@reduxjs/toolkit";
const initialState = {
    data: {
        firstName: '',
        lastName: '',
        email: '',
        zipcode: '',
        streetAddress: '',
        city: '',
        stateName: '',
        country: '',
        homePhoneNumber: '',
        alternatePhoneNumber: '',
        emergencyContact: {
            firstName: '',
            lastName: '',
            phoneNumber: '',
            relationship: ''
        },
        references: [
            {
                id: 1,
                firstName: '',
                lastName: '',
                phoneNumber: '',
            }
        ]
    },
    personalInfoError: false,
};
export const personalInfoSlice = createSlice({
    name: 'personalInfo',
    initialState,
    reducers: {
        setPersonalInfo: (state, action) => {
            state.data = action.payload;
            state.personalInfoError = false;
        },
        setPersonalInfoError: (state, action) => {
            state.personalInfoError = action.payload;
        },
    }
});
export const { setPersonalInfo, setPersonalInfoError } = personalInfoSlice.actions;
export default personalInfoSlice.reducer;
